import { StyledRenopwacja } from "./styled";

export const Renowacja = () => {
  return (
    <StyledRenopwacja>
      <h2>
        Renowacja Felg w Żyrardowie i okolicach – Piaskowanie, Malowanie Proszkowe, Naprawa
        i Odtwarzanie Zniszczonych Felg
      </h2>
      <div>Profesjonalna renowacja felg aluminiowych i stalowych w Żyrardowie. Dokładne piaskowanie, malowanie proszkowe, prostowanie i spawanie uszkodzeń – kompleksowa naprawa nawet najbardziej zniszczonych felg.</div>
   <div>Specjalizujemy się w kompleksowej renowacji felg w Żyrardowie, przywracając nawet bardzo zniszczone felgi do fabrycznego wyglądu i pełnej sprawności. Wykonujemy profesjonalne piaskowanie strumieniowo-ścierne w celu dokładnego usunięcia starej farby, korozji i zabrudzeń. Każda felga jest starannie przygotowywana do malowania proszkowego, które zapewnia trwałą, odporną na uszkodzenia powłokę w wybranym kolorze.

Oferujemy również prostowanie felg na maszynach CNC, spawanie pęknięć i ubytków oraz odtwarzanie oryginalnego kształtu i profilu felgi z zachowaniem pełnej wytrzymałości. Każdy etap naprawy kontrolujemy pod kątem bezpieczeństwa i jakości. Nasz zakład w Żyrardowie obsługuje klientów indywidualnych i firmy – zapewniamy szybkie terminy, konkurencyjne ceny i doradztwo w wyborze technologii wykończenia. Przywróć swoim felgom nowy wygląd i przedłuż ich żywotność – skontaktuj się z nami już dziś!</div>
    </StyledRenopwacja>
  );
};
